import React, {memo} from 'react';
import styled from 'styled-components';
import dataset from '../dataset';

const HeaderContainer = styled.div`
    margin-top: 40px;

    background-color: #f605;
    width:100%;
    padding:0 100px;
    height:80px;
`;

const Header = memo(() => {
  const {nav} = dataset.header;
  return (
    <HeaderContainer>
      <h1>Header</h1>
      <div>
        {nav.map((v, i) =>{
          return(
            <div>{v.logo}</div>
          )
        })}
      </div>
    </HeaderContainer>
  );
});

export default Header;
